import React from 'react'
import CardList from './CardList'; 
import robots from './robots'; 
import SearchBox from 'SearcBox'; 

const App = () => {
    return (
        <div> 
            <h1> RoboFriends </h1>
            <SearchBox />
            <CardList robots={robots}/>   
        </div>
    )
}

export default App;
